///REDUCER  /////////////////////////
const initState={
    yout:[],
    count:0
}

  const YoutReducer =(state=initState,{type,payload})=>{


    switch(type){

        case 'WATCH_LATER':
            return{
                ...state,
                // yout:payload,
                const:state.count + payload   
            }

            default:
                return state
    }
    
}

export default YoutReducer;


//ACTION   /////////////////////////////////////////////////////////
export const watchLater=()=>{
    return{
        type:'WATCH_LATER',
        payload:1
    }


}
